def youtosan(data):

	i = 0
	j = 0
	k = 0
	a1 = ['COM']
	a2 = []
	P1 = []
	P2 = []
	while i + 6 < len(data): #parse string
		P1.append(data[i] + data[i+1] + data[i+2])
		P2.append(data[i+4] + data[i+5] + data[i+6])
		i += 7
	N = P2.index('YOU')
	M = P2.index('SAN')
	while P1[N] != 'COM': #create a sequence that will take you to the sun
		k += 1 
		a1.append(P1[N])
		N = P2.index(P1[N])
	while P1[M] != 'COM': #create a sequence from the sun to santa
		j += 1 
		a2.append(P1[M])
		M = P2.index(P1[M])
	a3 = list(set(a1).intersection(a2)) #how many orbits we covered twice
	print(j + k - 2 * len(a3)) 

